function Other() {

    database.readItem('qqch/', '').then(val => {
        console.log(
            Object.fromEntries(Object.entries(val).filter( ([ id, item ]) => item.LOL && item.LOL === "haha" ))
        )
    })

    return <div>haha</div>

}

export default Other;
